import React from "react";
import Slider from "react-slick";
import rapperImage from "../../resources/HomeSlider/Rapper-bohemia.jpg";
import djImage from "../../resources/HomeSlider/nucleya-in-action.jpg";
import bboyImage from "../../resources/HomeSlider/bboying girl.jpg";
import beatBoxerImage from "../../resources/HomeSlider/indian-beatboxer.jpg";
import GrafImage from "../../resources/HomeSlider/Grafeti.jpg";

const HomeSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div style={{ "background-color": "white" }}>
      <Slider {...settings}>
        <div>
          {/* <h1>1 Slide</h1> */}
          <img
            src={rapperImage}
            style={{ height: "500px", width: "100%" }}
          ></img>
        </div>
        <div>
          {/* <h1>2 Slide</h1> */}
          <img src={djImage} style={{ height: "500px", width: "100%" }}></img>
        </div>
        <div>
          {/* <h1>3 Slide</h1> */}
          <img src={bboyImage} style={{ height: "500px", width: "100%" }}></img>
        </div>
        <div>
          {/* <h1>4 Slide</h1> */}
          <img src={beatBoxerImage}></img>
        </div>
        <div>
          {/* <h1>5 Slide</h1> */}
          <img src={GrafImage}></img>
        </div>
      </Slider>
    </div>
  );
};

export default HomeSlider;
